          - long years.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'It is thus in mind of my prior fidelity that I urge you '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - 'consider my words here not as a slight of your '
        - !ruby/object:RPG::EventCommand
          code: 401
