        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'In fact, I believe his removal would suit her quite '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - directly.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - The family and its history are the core of our team.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'Should the lineage falter, then I ask, what still gives '
        - !ruby/object:RPG::EventCommand
